demo.repl.help:
उपलब्ध कमाण्डहरू:
  @show              ─ अन्तिम adaptive card सारांश देखाउनुहोस्
  @json              ─ flow बाट प्राप्त कच्चा JSON मान निकाल्नुहोस्
  @back              ─ अघिल्लो अवरुद्ध card/inputs अवस्थामा फर्कनुहोस्
  @input <k>=<v>     ─ input field सेट वा ओभरराइड गर्नुहोस्
  @click <action_id> ─ दिइएको action सहित card submit गर्नुहोस्
  @help              ─ यो help पाठ छाप्नुहोस्
  @quit              ─ REPL बाट बाहिर निस्कनुहोस्
